import React, { Component } from 'react';
import NavBar from './nav.js'


class MakePlan extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }
    render() {
        return (
            <div className="container">
                <NavBar 
                    profile = ''
                    makePlan = ' active'
                    settings = ''
                    expenseReport = ''/>

                <p>This is going to be making plan page</p>
            </div>
        );
    }
}

export default MakePlan;
